<!DOCTYPE html>
<html>
<head>
  <title>REACTPSPLUSMOD</title>
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <style>
	input {
	width: 70px;
	height: 40px;
	font-size: 30px;
	color: red;
	text-align: center;
	}
	button {
	display: inline-block;
	width: 120px;
	height: 60px;
	font-size: 40px;
	border: none;
	background-color: lime;
	color: white;
	cursor: pointer;
	text-align: center;
	}
    .loader {
      display: -webkit-flex; /* Safari */
	  -webkit-align-items: center; /* Safari 7.0+ */
	  display: flex;
	  align-items: center;
	  border-radius: 50%;
      border-radius: 50%;
      border-top: 25px solid lime;
      border-bottom: 25px solid lime;
	  border-left: 25px solid black;
      border-right: 25px solid black;
      width: 600px;
      height: 600px;
      -webkit-animation: spin 1s linear infinite;
    }
    .info {
      overflow: hidden;
      position: fixed;
      position: absolute;
      top: 50%;
      left: 50%;
      font-size: 45px;
      font-family: sans-serif;
      transform: translate(-50%, -50%);
    }
    @-webkit-keyframes spin {
      0% { -webkit-transform: rotate(0deg); }
      100% { -webkit-transform: rotate(360deg); }
    }
  </style>
</head>
<body bgcolor="black" style="margin:0;">
  <script>
    window.didload = 0;
    window.didpost = 0;
    window.onload = function () {
      window.didload = 1;
      if (window.didpost == 1)
        setTimeout(window.stage2, 1500);
    }
    window.postExpl = function () {
      window.didpost = 1;
      if (window.didload == 1)
        setTimeout(window.stage2, 1500);
    }
    function allset() {
      document.getElementById("loader").style.display = "none";
      document.getElementById("allset").style.display = "block";
    }
    function awaitpl() {
      document.getElementById("loader").style.display = "none";
      document.getElementById("awaiting").style.display = "block";
    }
    function fail(info) {
      document.getElementById("loader").style.display = "none";
      document.getElementById("fail").style.display = "block";
    }
    function showtime() {
      document.getElementById("loader").style.display = "none";
      document.getElementById("date").style.display = "block";
    }
    function settime() {
      var year = document.getElementById("year").value;
      var month = document.getElementById("month").value;
      var day = document.getElementById("day").value;
      var hours = document.getElementById("hour").value;
      var minutes = document.getElementById("minute").value;
      window.setRTC(year, month, day, hours, minutes, 0);
    }
  </script>
